import React, { Component } from 'react';

class Rechercher extends Component {
    render() {
      return (
        <div className="recherche">
        <div className="row">
            <div className="col-md-6">
            <input id="recherche" class="form-control form-control-lg form-control-borderless" type="search" placeholder="Recherche"/>
            </div>
            <div className="col-md-6">
                <button class="btn btn-lg btn-success" type="submit">Rechercher</button>
            </div>
        </div>
        </div>
      );
    }
  }

  export default Rechercher;
